								<blockquote><p>          苔痕微景观设计团队是由学生牵头，集各大设计专业学生共九名大学生自主成立的微景观设计团队。团队的前身是2015年5月10日成立的无敌微景观设计团队，曾获得广东海洋大学举办的微景观设计一等奖，创意盆栽设计一等奖，生态模型一等奖，首届鱼缸景观设计大赛二等奖等各项校级比赛，团队坚持“美好的生活，不一样的开始”的理念，致力于创造风格独特，寓意深远的微景观产品。用心打造室内生态环境，公司秉承 “质量上乘，价格实惠，服务周到”的宗旨，力求让顾客满意我们的产品，让顾客喜欢我们的产品，让顾客享受我们的产品带来的愉悦！</p>
